import React, { useState } from "react";
import { connect } from "react-redux";
import { addproduct } from "../../../actions/productAction";
import { useHistory } from "react-router-dom";
import { message, Input, Button, Form, Select } from "antd";

const { Option } = Select;

const AddProduct = ({ addproduct }) => {
  const [formData, setFormData] = useState({
    name: "",
    description: "",
    price: "",
    quantity: "",
    category: "",
    brand: "",
  });

  const history = useHistory();

  const { name, description, price, brand, quantity, category } = formData;

  const onChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const onCategoryChange = (value) => {
    setFormData({ ...formData, category: value });
  };

  const onSubmit = async (e) => {
    e.preventDefault();
    if (!name || !description || !price || !brand || !quantity || !category) {
      return message.error("All fields are required");
    }

    const newProduct = {
      name,
      description,
      price,
      brand,
      quantity,
      category,
    };

    try {
      await addproduct(newProduct);
      message.success("Product added successfully!");
      setFormData({
        name: "",
        description: "",
        price: "",
        quantity: "",
        category: "",
        brand: "",
      });
      setLoading(false);
      history.push("/dashboard/product");
    } catch (error) {
      message.error("Failed to add product. Please try again.");
      setLoading(false);
    }
  };

  return (
    <div style={{ textAlign: "center", maxWidth: "600px", margin: "auto" }}>
      <h1>Add Product</h1>
      <Form layout="vertical" onSubmit={onSubmit}>
        <Form.Item label="Name">
          <Input
            type="text"
            placeholder="Name of product"
            name="name"
            value={name}
            onChange={onChange}
          />
        </Form.Item>
        <Form.Item label="Description">
          <Input.TextArea
            placeholder="Give a brief description of the product"
            name="description"
            value={description}
            onChange={onChange}
          />
        </Form.Item>
        <Form.Item label="Price">
          <Input
            type="number"
            placeholder="Enter the price of the product"
            name="price"
            value={price}
            onChange={onChange}
          />
        </Form.Item>
        <Form.Item label="Brand">
          <Input
            type="text"
            placeholder="Enter the brand of the product"
            name="brand"
            value={brand}
            onChange={onChange}
          />
        </Form.Item>
        <Form.Item label="Quantity">
          <Input
            type="number"
            placeholder="Number of the product"
            name="quantity"
            value={quantity}
            onChange={onChange}
          />
        </Form.Item>
        <Form.Item label="Category">
          <Select
            name="category"
            value={category}
            onChange={onCategoryChange}
            placeholder="Select a category for the product"
          >
            <Option value="Clothing">Clothing</Option>
            <Option value="Electronics">Electronics</Option>
            <Option value="Furniture">Furniture</Option>
            <Option value="Toys">Toys</Option>
            <Option value="Books">Books</Option>
          </Select>
        </Form.Item>
        <Form.Item>
          <Button type="primary" htmlType="submit" onClick={this.onSubmit}>
            Submit
          </Button>
        </Form.Item>
      </Form>
    </div>
  );
};

export default connect(null, { addproduct })(AddProduct);
